(136, 'steam:1100001085db029', 'Daniel', 'Rogers', '11/21/1994', 'Character Backstory:\nA Brooklyn lad through and through. Daniel grew up amongst hoodlums and thugs, turning his back on family and friends to become a police officer, his intial goal to make enough money to transfer with his paramour to the west coast. But as time wore on, their relationship became more and more frayed, resulting in a messy divorce.\nWith enough money saved for a ticket and not much else, Daniel arrived in Los Santos, intent on making a fresh start there. Away from cheating wives, bribes and the most smog-filled borough in New York City.\nBut the department didn\'t need him and work as a PI proved a dreadfully boring replacement for police work.\n\nPresent:\nLooking for a dame to walk into his \"office\" and drop a real case in his lap, to give him a break from snapping pictures of cheating scumbag husbands or adulterous trophy wives. A task easier if his office wasn\'t a dive-bar toilet... and something that might also be easier if countless rumours weren\'t swirling about over shapeshifters, UFOs, demons and other supernatural occurances in Los Santos.', 'notset', '{\"weapon\":{\"status\":\"ACTIVE\",\"date\":27400254,\"type\":\"weapon\",\"infractions\":0},\"driver\":{\"status\":\"ACTIVE\",\"date\":60139496,\"type\":\"driver\",\"infractions\":0}}', 229521, '[{\"name\":\"Dan Cooper\",\"luaid\":1,\"number\":\"521145\"}]', 0, 1492, 11800, '1885233650', '[{\"index\":0,\"type\":\"drawable\",\"name\":\"head\",\"drawable\":4,\"texture\":0,\"pallette\":0},{\"index\":1,\"type\":\"drawable\",\"name\":\"beard\",\"drawable\":0,\"texture\":0,\"pallette\":0},{\"index\":2,\"type\":\"drawable\",\"name\":\"hair\",\"drawable\":10,\"texture\":1,\"pallette\":1},{\"index\":3,\"type\":\"drawable\",\"name\":\"torso\",\"drawable\":4,\"texture\":0,\"pallette\":0},{\"index\":4,\"type\":\"drawable\",\"name\":\"legs\",\"drawable\":10,\"texture\":0,\"pallette\":0},{\"index\":5,\"type\":\"drawable\",\"name\":\"h