(139, 'steam:11000010cc2836a', 'Quinn', 'Leeden', '21-12-1994', 'Name: Quinn Leeden\n\nAge: 1994 December 12th\n\nFirst Language: English\n\nFavorite Colors: Red\n\nFavorite Things to do: Drinking whiskey mixed with coca cola and driving off road\n\nPersonality/Attitude: Quinn is a person who would do anything for anyone to help them out if they show him appreciation, he is a hard-working EMS employee and hosts community events on the side.\n\nSkills: He has a lot of social skills and currently studying psychology in the evenings, He tends to be friendly but stern to others and help them out to the best of his abilities.\n\nDislikes: Quinn dislikes people that are impatient regarding his job or people who show disloyalty towards there friends and family, other than that he also dislikes dumbasses that regularly mess up the city.\n\nWeaknesses: Quinn can come of strong and sounding mean but if you give him the time he will show great compassion and friendliness. He is also a workaholic he does not spend much time with friends due to work.\n\nStrange behaviors: Quinn goes up the mountains from time to time to have some alone time and think about where his life is going he will never take anyone up the mountains because he values this as his alone time and private space.\n\nHabits: Yelling at locals and hate it when people drive like crazy.\n\nBackground story: Quinn moved into the city about three months ago after he heard his brother Edwin moved to Los Santos. Quinn was meant to bring Edwin the bad news of the passing of their father but due to the brother’s poor relationship Edwin didn’t want to meet Quinn. And from that moment on Quinn became interested in Los Santos and wondered if he would be able to join EMS seeing at that point in time EMS was massively underemployed and Quinn always wanted to help those in need.', 'notset', '{\"driver\":{\"date\":16430626,\"infractions\":0,\"status\":\"ACTIVE\",\"type\":\"driver\"}}', -1, '', 0, 500, 15000, '1885233650', '[{\"