(146, 'steam:1100001038a2c52', 'Bruce', 'Jackson', '10/09/1990', 'I was born and raised in England by two loving parents, I didn\'t have any brothers and sisters, sometimes I wonder what it would have been like to have a sibling to mess around with, but I was always close to my cousin, shame I only saw him a few times a year. Overall, I\'d say I had an easy childhood, flying through school with excellent grades and making lots of friends along the way. My parents and elders always expected too much from be to be honest, they wanted me to end up being something amazing like a lawyer, doctor; anything that met their middle-class stereotype. College wasn\'t too hard for me, luckily I\'ve always been quite gifted in terms of my knowledge and academic ability. I tried to keep my nose clean and avoid getting into any illicit activities and keep the partying to a minimum, but every student loves a party! Once I finished college, my parents pushed me into Medical School but I dropped out after a couple of years and starting doing odd-jobs in my home town trying to scrape up some money to get away. They never really looked at me the same way after I disappointed them by not following the plan they had laid before me, but I refuse to live my life being guided by other people... I live my life for me!', 'notset', '{\"driver\":{\"status\":\"ACTIVE\",\"date\":30852531,\"type\":\"driver\",\"infractions\":0}}', 141711, '', 0, 483, 3950, '349505262', '[{\"texture\":0,\"drawable\":0,\"pallette\":0,\"name\":\"head\",\"type\":\"drawable\",\"index\":0},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"name\":\"beard\",\"type\":\"drawable\",\"index\":1},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"name\":\"hair\",\"type\":\"drawable\",\"index\":2},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"name\":\"torso\",\"type\":\"drawable\",\"index\":3},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"name\":\"legs\",\"type\":\"drawable\",\"index\":4},{\"texture\":0,\"drawable\":0,\"pallette\":0,\"