(230, 'steam:1100001034e187b', 'Tom ', 'Booth', '02/19/1983', 'Tom is a local from Sandy Shores.  His mother was a prostitute who worked the local beer and pool joints in Sandy and Paleto Bay.  Occasionally she would venture into Los Santos itself if she needed a big score.  She was a heavy smoker and smoked everywhere she went.  She smoked with Young Tom in the car with t he windows rolled up, at home, even at the supper table.  One night Tom woke to the fact that his throat had closed to some much second hand smoke inhalation.  His mother in desperation used a pen to jab a hole in his throat so he could breath on the way to the hospital.  Tom had to wear a tracheotomy device for years until the tissue in his throat could build strength.  This all causing Tom to talk with a very hoarse voice for the rest of his life.  His mother died when Tom was 19 in a freak sexual act she had been paid highly to perform.  Tom Moved to Los Santos to find work and forget his past.', 'notset', '', -1, '', 0, 0, 2902, '-2114499097', '[{\"type\":\"drawable\",\"name\":\"head\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":0},{\"type\":\"drawable\",\"name\":\"beard\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":1},{\"type\":\"drawable\",\"name\":\"hair\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":2},{\"type\":\"drawable\",\"name\":\"torso\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":3},{\"type\":\"drawable\",\"name\":\"legs\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":4},{\"type\":\"drawable\",\"name\":\"hands\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":5},{\"type\":\"drawable\",\"name\":\"feet\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":6},{\"type\":\"drawable\",\"name\":\"necklace\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":7},{\"type\":\"drawable\",\"name\":\"accessories1\",\"texture\":0,\"pallette\":0,\"drawable\":0,\"index\":8},{\"type\":\"drawable\",\"name\":\"accessories2\",\"texture\":0,\"pall